#!/usr/bin/env node
/* eslint-disable no-console */

const fs = require("fs/promises");
const process = require("process");

// Paste your Base64-encoded PDF string between the backticks.
// If this is non-empty, you can run: `node extractPdfTextFromBase64.js`
// and it will print ONLY the extracted text to stdout.
const INLINE_BASE64 = ``;

let pdfParse;
try {
  pdfParse = require("pdf-parse");
} catch (err) {
  if (err && typeof err === "object" && "code" in err && err.code === "MODULE_NOT_FOUND") {
    console.error("Missing dependency: pdf-parse");
    console.error("Install it with `npm install pdf-parse` and rerun the script.");
  } else {
    console.error("Failed to load pdf-parse:", err && err.message ? err.message : err);
  }
  if (require.main === module) {
    process.exit(1);
  }
}

function parseArgs(argv) {
  const args = {
    inputB64: null,
    inputFile: null,
    outputPath: null,
  };
  if (!argv || argv.length === 0) return args;
  for (let i = 0; i < argv.length; i += 1) {
    const arg = argv[i];
    if (arg === "--input-b64") {
      const next = argv[i + 1];
      if (!next || next.startsWith("-")) throw new Error("Missing value for --input-b64");
      args.inputB64 = next;
      i += 1;
    } else if (arg === "--input-file") {
      const next = argv[i + 1];
      if (!next || next.startsWith("-")) throw new Error("Missing value for --input-file");
      args.inputFile = next;
      i += 1;
    } else if (arg === "--output" || arg === "-o") {
      const next = argv[i + 1];
      if (!next || next.startsWith("-")) throw new Error("Missing value for --output");
      args.outputPath = next;
      i += 1;
    } else {
      throw new Error(`Unrecognized argument: ${arg}`);
    }
  }
  if (!args.inputB64 && !args.inputFile) {
    // Allow empty args if INLINE_BASE64 is provided
    if (!INLINE_BASE64 || INLINE_BASE64.trim().length === 0) {
      throw new Error("Provide --input-b64 <BASE64>, --input-file <path>, or paste into INLINE_BASE64");
    }
  }
  return args;
}

async function getBase64({ inputB64, inputFile }) {
  if (inputB64) return inputB64;
  if (!inputB64 && !inputFile && INLINE_BASE64 && INLINE_BASE64.trim().length > 0) {
    return INLINE_BASE64;
  }
  const txt = await fs.readFile(inputFile, { encoding: "utf8" });
  return txt.trim();
}

async function extractTextFromBase64(base64) {
  // Normalize potential whitespace/newlines in base64 blocks
  const normalized = base64.replace(/\s+/g, "");
  const buffer = Buffer.from(normalized, "base64");
  
  // Use standard pdf-parse API
  const data = await pdfParse(buffer);
  return (data.text || "").trim();
}

async function main() {
  let args;
  try {
    args = parseArgs(process.argv.slice(2));
  } catch (err) {
    console.error(`Failed to parse arguments: ${err.message}`);
    process.exit(1);
    return;
  }

  try {
    const b64 = await getBase64(args);
    const text = await extractTextFromBase64(b64);
    if (args.outputPath) {
      await fs.writeFile(args.outputPath, text, { encoding: "utf8" });
    } else {
      process.stdout.write(text);
      if (!text.endsWith("\n")) process.stdout.write("\n");
    }
  } catch (err) {
    console.error(`Failed to extract text: ${err.message}`);
    process.exit(1);
  }
}

if (require.main === module) {
  main();
}

module.exports = {
  extractTextFromBase64,
};

